import React from "react";
import MachineSales from "../../../components/Machine/Notify/MachineSales";
// import MachineReplenishment from "../../../components/Machine/Notify/MachineReplenishment";
function MachineNotificationSetting() {
  return (
    <div className="container-lg">
      <MachineSales
        title={"銷售通知"}
        telSpan={"銷售通知電話號碼"}
        emailSpan={"機器銷售後，發送信箱"}
      />
      <MachineSales
        title={"運補通知"}
        tooltip={"機器貨道商品售鑿將發送通知"}
        telSpan={"運補通知電話號碼"}
        emailSpan={"運補通知後，發送信箱"}
      />
      <MachineSales
        title={"發票通知"}
        tooltip={"發票事件相關通知聯絡人"}
        telSpan={"發票通知電話號碼"}
        emailSpan={"發票通知後，發送信箱"}
      />
      <MachineSales
        title={"機器異常通知"}
        tooltip={"機器異常事件通知聯絡人"}
        telSpan={"機器異常電話號碼"}
        emailSpan={"機器異常後，發送信箱"}
      />
      <div className="d-flex justify-content-center mb-5">
        <button className="btn btn-light me-3">返回</button>
        <button className="btn btn-success text-white">確認</button>
      </div>
    </div>
  );
}

export default MachineNotificationSetting;
